import React from "react";
import { connect } from "react-redux";
import Phaser from "phaser";

const config = {
  type: Phaser.AUTO,
  width: 800,
  height: 600,
  scale: {
    parent: "game-container",
  },
};

export function GameScene() {
  new Phaser.Game(config);
}

export default connect(null, null)(GameScene);
